childProps.isActive:
(el, s) => {
        const key = parseInt(el.key)
        const {
          gridOptions
        } = s.settings
        const h = Math.floor(key / 12) + 1
        const w = key % 12 + 1
        return gridOptions?.w >= w && gridOptions?.h >= h
      }

childProps.onClick:
(ev, el, s) => {
        const key = parseInt(el.key)
        const h = Math.floor(key / 12) + 1
        const w = key % 12 + 1
        s.update({
          settings: {
            gridOptions: {
              w,
              h
            }
          }
        })
      }

Iframe.onRenderScene:
(el, s) => {
      const value = el.call('isString', s.value) ? el.call('evalStringCodeUnsafe', s.value) : s.value

      const {
        useLibrary,
        frameProps,
        useRouter,
        useAppjs,
        initOptions
      } =
      el.parent.props
      if (!value) return

      window.requestAnimationFrame(async () => {
        await el.call('renderStateComponent', value, el, s, {
          useLibrary,
          frameProps,
          useRouter,
          useAppjs,
          initOptions
        })
      })
    }

Iframe.onRender:
(el, s, ctx) => {
      el.node.onload = () => el.props.onRenderScene(el, s, ctx)
    }

