(_, el, s) => {
    if (el.call('getCookie', `sidebar_${s.type}`) === 'false') {
      return false
    }

    if (s.editing) {
      return
    }

    const {
      node
    } = el

    const scroll =
      el.getUserSettings('explorerAutoscroll') &&
      s.key &&
      s.key === el.getSelectedKey()

    if (!scroll) {
      return
    }

    if (el.getRootData().sidebarClick) {
      el.getRootData().sidebarClick = false
      return
    }

    const t = setTimeout(() => {
      if (!node || !node.scrollIntoView) {
        return
      }
      node.scrollIntoView({
