/signup.onInit:
(el, s) => {
    const searchParams = new URLSearchParams(window.location.search)
    const hasToken = searchParams.has('token')
    if (hasToken) {
      const token = searchParams.get('token')
      const splittedToken = token.split('.')
      if (splittedToken.length > 1) {
        try {
          const decodedToken = JSON.parse(atob(splittedToken[1]))
          s.quietUpdate({
            email: decodedToken.email,
            hasToken
          })
        } catch (e) {
          console.error('Problem with Signup Token', e)
        }
      }
    }
  }

LoginWindow.onSubmit:
async (ev, el, s) => {
      ev.preventDefault()
      s.update({
        loading: true
      })

      const {
        email,
        password,
        name
      } = s.parse()
      const currentUrl = new URL(window.location.href)
      const token = currentUrl.searchParams.get('token')

      try {
        const pluginSession = el.call('getPluginSessionFromUrl')
        const payload = {
          email,
          password,
          name,
          callbackUrl: `${window.location.origin}/signup-confirmation`,
          inviteToken: token
        }
        if (pluginSession) {
          await el.sdk.register(payload, {
            session: pluginSession
          })
        } else {
          await el.sdk.register(payload)
        }
      } catch (ex) {
        el.call('openNotification', {
          title: 'Error message',
          message: `${ex}`,
          type: 'error'
        })
        s.update({
          loading: false
        })
        el.call('applyLoader', {
          value: false,
          force: true,
          timeout: 1
        })
        return
      }

      s.update({
        loading: false,
        confirm: true
      })

      if (el.isAuthorised()) {
        await el.call('fetchUser')
      }

      el.call('applyLoader', {
        value: false,
        force: true,
        timeout: 1
      })

      if (window.plausible) {
        window.plausible('Signup')
      }

      if (s.error) {
