LoginWindow.onSubmit:
async (ev, el, s) => {
      ev.preventDefault()
      s.update({
        loading: true
      })

      if (s.token) {
        if (s.password !== s.repeatPassword) {
          s.update({
            repeatPasswordTouched: true,
            loading: false
          })
          return el.call('openNotification', {
            title: 'Failed to change password',
            message: 'Passwords do not match',
            type: 'error'
          })
        }
        try {
          await el.sdk.confirmPasswordReset(s.token, s.password)
          el.call('openNotification', {
            title: 'Success',
            message: 'Password has been successfully changed',
            type: 'success'
          })
          // await signin.LoginWindow.onSubmit(ev, el, s) why is login called in reset password?
          setTimeout(() => {
            el.router('/signin', el.getRoot(), {})
          }, 200)
        } catch (e) {
          s.update({
            loading: false
          })
          el.call('openNotification', {
            title: 'Error message',
            message: `${e}`,
            type: 'error'
          })
        }
        return
      }
      if (!s.email) {
        s.update({
          touched: true,
          loading: false
        })
        return
      }
      try {
        await el.sdk.requestPasswordReset(s.email)
        s.update({
          sent: true
        })
      } catch (e) {
        s.update({
          loading: false
        })
        el.call('openNotification', {
          title: 'Error message',
          message: `${e}`,
          type: 'error'
        })
      }
    }

