/**
 * Computes the padding value in 'em' units based on the given value and element's unit.
 *
 * @param {number} val - The 'paddingEm' property applied in props.
 * @param {Object} element - The element object.
 * @param {Object} state - The element's state object.
 * @param {Object} context - The global context object.
 */

export default function paddingEm (val, element, state, context) {
  const { unit } = element.props
  const paddingEm = unit === 'em' ? val / 16 + 'em' : val
  return { paddingEm }
}

