      const isActive = s.isActive || (s.isActive !== false && activeFromUrlHash)
      const isActiveRow = isActive ? activeRow : {
        margin: '0',
        cursor: 'default',
        background: 'transparent 0',
        '@dark': {
          background: 'transparent 0'
        },
        '@light': {
