        ':not(:first-child)': {
          '@dark': {
            border: '--color-line-highlight-dark, solid'
          },
          '@light': {
            border: '--color-line-highlight-light, solid'
          },
          borderWidth: '1px 0 0'
        },

        transition: '100ms, 100ms, 350ms, 350ms',
        transitionProperty: 'background, opacity, margin, padding',
        opacity: '0.85',

        ...isActiveRow,
        ':focus': activeRow,
        ':hover': activeRow,

        onInit: (el, s) => {
          const isActive = s.title === window.location.hash.slice(1)
          if (isActive) {
            s.isActive = true
          }
        },

        onClick: (ev, el, s) => {
          if (s.isActive) return
          Object.values(el.parent.parse())
            .filter(v => v && v.state)
            .map(v => v.state && v.state.update({
              isActive: !s.isActive && s.title === v.state.title
            }))
          ev.preventDefault()
        }
      }
    }

