function tutorialState() {
    const activeRoute = this.call('getLocationPath', 1) ?
      this.call('getLocationPath', 1).slice(1) :
      'default'
    const {
      TUTORIALS
    } = this.context.snippets
    const activeTutorial = TUTORIALS[activeRoute] || TUTORIALS.default
    const {
      title,
      data
    } = activeTutorial
    const activeStepData = data[this.state.activeStep || 0]
    // console.warn('activeStepData', activeStepData)
    const {
      code
    } = activeStepData
    const value = this.call('evalStringCodeUnsafe', code)

    return {
      data,
      activeStep: this.state.activeStep || 0,
      tutorialName: title,
      ...activeStepData,
      code,
      value
    }
  }

