functions.findSecondLevelMatches:
function findSecondLevelMatches(sitemap, pathname) {
    let matchedItem = null
    let maxMatchLength = 0

    sitemap.forEach(item => {
      if (item.sub_links) {
        item.sub_links.forEach(firstLevel => {
          if (
            pathname.includes(firstLevel.href) &&
            firstLevel.href.length > maxMatchLength
          ) {
            maxMatchLength = firstLevel.href.length
            matchedItem = firstLevel
          }
        })
      }
    })

    return matchedItem
  }

functions.findFirstLevelMatches:
function findFirstLevelMatches(sitemap, pathname) {
    let matchedItem = null
    let maxMatchLength = 0

    sitemap.forEach(item => {
      if (pathname.includes(item.href) && item.href.length > maxMatchLength) {
        maxMatchLength = item.href.length
        matchedItem = item
      }
    })

    return matchedItem
  }

functions.subnavLinksHasPages:
function subnavLinksHasPages() {
    // Check if sub_links exists and has at least one non-fragment link
    return this.state.sub_links?.some(
      link =>
      // Check both direct links and nested sub_links
      !link.href?.includes('#') ||
      link.sub_links?.some(nestedLink => !nestedLink.href?.includes('#'))
    )
  }

functions.hasActiveSubnavChild:
function hasActiveSubnavChild() {
    if (this.state.showSubnav !== undefined) {
      return this.state.showSubnav
    }

    const pathnameDocs =
      this.call('getLocationPath', 0) + (this.call('getLocationPath', 1) || '')

    const collectLinks = (links) => {
      if (!links) return []
      return links.flatMap((link) => {
        const selfRefs = link.href ? [link.href] : []
        const childRefs = collectLinks(link.sub_links)
        return [...selfRefs, ...childRefs]
      })
    }

    const allRefs = (this.state.href ? [this.state.href] : [])
      .concat(collectLinks(this.state.sub_links))
      .filter((v) => !v.includes('#'))

    return allRefs.includes(pathnameDocs)
  }

functions.findDeepestMatch:
function findDeepestMatch(sitemap, pathname) {
    let matchedItem = null
    let maxMatchLength = 0

    const search = links => {
      if (!links) return
      links.forEach(link => {
        if (pathname.includes(link.href) && link.href.length > maxMatchLength) {
          maxMatchLength = link.href.length
          matchedItem = link
        }
        if (link.sub_links) search(link.sub_links)
      })
    }

    search(sitemap)
    return matchedItem
  }

