functions.setTypesTooltipPosition:
function(options = {}) {
    const key = parseInt(this.key)
    const rowWidth = `(var(--font-size-B) + var(--spacing-Z))`
    const translateX = `calc(${rowWidth} * ${key} - 50%)`
    const transform = `translate3d(${translateX}, 0, 0)`
    const Tooltip = this.lookup('Tooltip')
    if (Tooltip.setProps) {
      Tooltip.setProps({
        opacity: options.visible && '1',
        visibility: options.visible && 'visible',
        text: this.state.value,
        transform
      })
    }
  }

functions.setPaginationNames:
function setPaginationNames(mapArr) {
    const sitemap = mapArr || this.call('getSnippet', 'DOCS_SITEMAP', 'array')
    const {
      pathname
    } = window.location
    const hrefArray = this.call('filterHrefs', sitemap)
    const state = {}

    hrefArray.forEach((v, k) => {
      const categoryRoute = v[0]
      const subcategoryRoutes = v[1]
      const previousCat = sitemap[k - 1]
      const activeCat = sitemap[k]
      const nextCat = sitemap[k + 1]

      const isRootCategory = categoryRoute === pathname
      const isSubcategory =
        subcategoryRoutes && subcategoryRoutes.indexOf(pathname) > -1

      if (isRootCategory) {
        const previousSubcat =
          hrefArray[k - 1] &&
          hrefArray[k - 1][1] &&
          previousCat.sub_links[previousCat.sub_links.length - 1]
        const nextSubcat = subcategoryRoutes && activeCat.sub_links[0]

        state.previous = previousSubcat || previousCat
        state.active = activeCat
        state.next = nextSubcat || nextCat
        state.moveOn = nextSubcat && nextCat
      } else if (isSubcategory) {
        const i = subcategoryRoutes.indexOf(pathname)
        const activeSubcat = activeCat.sub_links[i]
        const previousSubcat =
          subcategoryRoutes[i - 1] && activeCat.sub_links[i - 1]
        const nextSubcat = subcategoryRoutes[i + 1] && activeCat.sub_links[i + 1]

        state.previous = previousSubcat || activeCat
        state.active = activeSubcat
        state.next = nextSubcat || nextCat
        state.moveOn = nextSubcat && nextCat
      }
    })

    return state
  }

functions.findCurrentIndex:
function findCurrentIndex(sitemap) {
    const {
      pathname
    } = window.location
    const hrefArray = this.call('filterHrefs', sitemap)
    let index

    hrefArray.forEach((v, k) => {
      if (v[0] === pathname) index = k
      if (v[1] && v[1].indexOf(pathname) > -1) {
        const i = v[1].indexOf(pathname)
        index = `${k}.${i}`
      }
    })

    return {
      isActive: index
    }
  }

functions.filterHrefs:
function filterHrefs(sitemap) {
    return Object.values(sitemap)
      .map(({
          href,
          sub_links
        }) => // eslint-disable-line
        [href, sub_links.map(({
            href
          }) => href) // eslint-disable-line
          .filter(v => v.indexOf('#') === -1)
        ]
        .filter(v => v.length > 0)
      )
  }

functions.getSnippet:
function getSnippet(key, type) {
    const snippet = this.context.snippets[key]
    if (!snippet) return this.warn(key, 'snippet was not found')
    if (type === 'array') return Object.values(snippet)
    else return snippet
  }

