functions.dropdownClick:
async function dropdownClick (event) {
  const element = this
  const { state, context } = element
  if (state.subdropdown) {
    event.stopPropagation()
    const Dropdown = element.lookup('Dropdown')
    const SubDropdown = element.lookup('SubDropdown')

    const { top: dropdownTop, left: dropdownLeft } =
      Dropdown.node.getBoundingClientRect()
    const { width, height } = SubDropdown.node.getBoundingClientRect()
    const { top, left } = element.node.getBoundingClientRect()
    const { innerWidth, innerHeight } = window

    const topPos = top - dropdownTop
    const leftPos = left - dropdownLeft

    const diffX = left + width * 2 > innerWidth ? width * 2 : 0
    const diffY =
      top + height > innerHeight ? Math.abs(innerHeight - top - height - 16) : 8

    SubDropdown.setNodeStyles({
      transform: `translate3d(${leftPos - diffX}px, ${topPos - diffY}px, 1px)`,
      pointerEvents: 'auto',
      visibility: 'visible',
      opacity: '1'
    })
    return
  }
  if (state.onClick) return await state.onClick(event, element, state, context)
  const Dropdown = element.lookup(el => el.props.isDropdownRoot)
  if (!Dropdown) return
  await Dropdown.props?.onChoose?.(
    event,
    Dropdown,
    Dropdown.state,
    Dropdown.context,
    element
  )
}

functions.goToDocsPage:
function goToDocsPage(href) {
  if (!this.call('isString', href)) {
    return this.warn('Href to docs link is not defined')
  }

  const isInternal = href.startsWith('/')
  if ((this.isCanvas() || this.isEmbed()) && isInternal) return this.setWindow('docs', href.replace('/docs', ''))
  this.router(href, this.getRoot())
}

functions.navigateDocs:
function navigateDocs(ev) {
  ev.preventDefault()
  const href = this.call('resolveHref', this.props.href)
  this.call('goToDocsPage', href)
}

functions.resolveHref:
function resolveHref(href) {
  const execHref = this.call('exec', href || this.props?.href || this.state?.href)

  if (this.call('isString', href)) {
    if (href.includes('{{')) {
      return this.call('replaceLiteralsWithObjectFields', execHref)
    }
    return execHref
  } else {
    return this.warn('Href to docs link is not defined')
  }
}

functions.isValidHTMLTag:
function isValidHTMLTag(v) {
  const HTML_TAGS = this.context.utils.HTML_TAGS
  return HTML_TAGS.root.indexOf(v) > -1 ||
    HTML_TAGS.body.indexOf(v) > -1
}
